INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(1, 'Rampage (2018)', 'Akció', 'Egy génmanipulációs űrállomás meg semmisül és a szennyezett törmelék visszahullik a földre. \nHárom vadállat fertőződik meg a mutáns kórokozóval. \nEgy amerikai krokodil, és egy farkas és egy George nevű ritka albínó gorilla, akivel Davis Okoye (Dwayne Johnson) \nprimatológus jelnyelven képes kommunikálni. Az állatokat megfertőző kórokozó, mutációt eredményez a DNS-ükbe, amiatt \naz állatok hatalmasra nőnek és agresszívak lesznek. Nyomukban csak a tombolás és a pusztítás jár. \nDavis és Dr. Kate Caldwell van csak a nyomukban, akik szeretnének nekik egy ellenszert beadni ami visszafordítja a \ntestükben lezajló mutációt.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(2, 'Jumanji: Vár a dzsungel (2017)', 'Kaland', 'Négy középiskolás a büntetésük alatt, az iskola pincéjében talál egy régi játék konzolt. \nEgy számukra ismeretlen játék fut rajta, aminek a neve: Jumanji. Elkezdenek vele játszani és a játék magába \nszippantja a gyerekeket.  Spencer (Dwayne Johnson) kigyűrt kalandorrá változik, Fridge (Kevin Hart) elméje \nmegelevenedik és okosabb lesz mindenkinél, a bombázó csajból (Jack Black) középkorú, professzor lesz, míg \na visszahúzódó Martha(Karen Gillan) egy harcos amazonná válik.\n', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(3, 'Törésvonal (2015)', 'Kaland', 'A Los Angeles-i tűzoltóság légimentő-pilótája, Raymond “Ray” Gaines (Dwayne Johnson) aki épp válik a \r\nfeleségétől és a lánya is messzire költözi tőle. Egy váratlan pillanatba San Franciscót egy 9-es fokozatú \r\nföldrengés semmisíti meg. Ray megtudja, hogy lányuk az egyik összedőlt irodaház rombaj között ragadt. \r\nFeleségével Los Angelesből észak felé indulnak, hogy felkutassák és megmentsék a lányukat. De az út, \r\na romokban heverő városokon át nem zökkenőmentes.', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(4, 'Eredet (2010)', 'Akció', 'Dom Cobb a legjobb tolvajok legjobbja. Viszont ő nem bankokba tör be, hanem mások elméjébe, kémkedik és \nadatokat, emlékeket, jelszavakat lop. Cobb legújabb megbízatása Robert Fischer, egy gigantikus méretű \nüzleti birodalom következő örököse, viszont Domnak most nem ellopnia kell egy információt, hanem elülteti \negy gondolat töredéket a célpontja fejében, mégpedig azt, hogy darabolja fel a cégét és mondjon le az \nüzletvezetésről.', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(5, 'Törtetők (2015)', 'Vígjáték', 'Vincent Chaset (Adrian Grenier) sokan irigylik és cserélnének vele bármikor. Fiatal, vonzó, színész, Hollywoodban él, \nés hatalmas karrier áll még előtte. Vincent fél attól, hogy a fejébe száll a hírnév és a dicsőség. Felkeresi gyerekkori \nbarátait és a lehető legtöbb időt próbálja velük tölteni. Közösen próbálják túlélni és kikerülni a Hollywoodi Álomgyár \nveszélyes csapdáit. Igyekeznek felismerni a hazugságokat, de emellett élvezni próbálják mindezt, amit a jómód, a szép \nnők, a lelkes rajongók és a minden hájjal megkent producerek kínálhatnak.', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(6, 'Tolvajtempó (2000)', 'Thriller', 'Memphis (Nicolas Cage) közismert autótolvaj, aki már jó ideje felhagyott a szakmájával. Átlag polgári életet él és gyereket \ntanít gokartozni. Egy napon az öccse újat húz a maffiával és Memphist hívja segítségül. A maffia nem enged. Megzsarolják, \nhogy egy éjszaka alatt lopjon el ötven ritka luxusautót és karcolás nélkül szállítsa la azokat, vagy az öccsét darabokban \nkapja vissza. Memphis felkeresi a régi cimboráit, hogy segítsenek neki még egyszer utoljára a régi idők emlékére és az öccse \néletéért cserébe. ', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(7, 'Mátrix (1999)', 'Sci-fi', 'Thomas Anderson nappal egy jól menő számítástechnikai cég programozója, éjjel azonban Neo álnéven hackerként tevékenykedik az interneten. \r\nAz egyik éjszaka kapcsolatba lép vele Trinity, aki felajánlja neki, hogy elviszi Morpheushoz, aki elmondja neki, hogy mi az a Mátrix. \r\nNeo él a lehetőségével és találkozik Morpheussal, aki elmondja neki, hogy két valóság létezik. Az egyik egy álomvilág, ahol az ember \r\nkiszolgáltatva, rabszolgaként sínylődik anélkül, hogy ezt fel tudná fogni. A másik pedig az igazi valóság.\r\n', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(8, 'Az – 2. fejezet (2019)', 'Horror', 'A Vesztesek Klubja szembenézett a lehetetlennel és legyőzte a félelmetes és gonosz Pennywise bohócot. A csoport tagjai szétszóródtak \r\na világban és felnőttek. De valahol legbelül a csoporttagok tudják, hogy soha nem felejthetik el a múltjukat. Hiába győzedelmeskedtek \r\na gonosz felett, mivel az elpusztíthatatlan…', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(9, 'Hang nélkül 2 (2020)', 'Horror', 'A Földre érkezett szuperérzékeny hallással rendelkező, agresszív idegenek az emberiség java részét elpusztították. A maréknyi túlélők \negy része a romok között bujkál és csendben próbál élni, míg egy részük kolóniát próbál építeni egy elzárt szigeten. Az Abbott család \notthona elpusztult így útnak indulnak. Útjuk során egy acélöntödében kötnek ki, ahol találkoznak Emmettbe, Lee visszahúzódó barátjába. \nKözben rájönnek, hogy a hallókészülék magas frekvenciájú gerjedése az idegen lényekre bénító hatással van. \n', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(10, 'Vaksötét 2 (2021)', 'Horror', 'Nyolc évvel azután, hogy a vak tengerészgyalogost, Norman Nordstrom-ot pár huligán ki akarta rabolni, a katona a tizenegy éves Phoenixszel \nés kutyájával, Árnyékkal él a város szélén. Norman folyamatosan védelmezi a lányt és egyedül nem engedi ki a házból.\na külvilággal, Hernandez, aki egy veterán katonai vadőr. Phoenix csak vele hagyhatja el a házat. Az egyik közös csajos napjukon egy banda \nkifigyeli a kislányt és követik hazafele a házához. Este betörnek a házba, a kutyát megölik és elrabolják a lányt. Mint kiderül, a banda \nvezére a lány apja, aki már jó ideje keresi a lányát, hogy visszavigye őt az anyjához és együtt éljenek tovább.', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(11, 'WALL·E (2008)', 'Animáció', '2110 körül az újrahasznosíthatatlan szemét olyannyira nagy mértékben felhalmozódott a Földön, hogy a bolygó többé nem volt képes tovább \r\nbiztosítani az élet feltételeit. Az emberek hatalmas csillaghajókon egy 5 éves küldetésre indultak a világűrbe. A Földön több százezernyi \r\nWALL·E robotot hagytak hátra, hogy azok feltakarítsák a szemetet. Viszont a terv kudarcba fulladt. Az emberek nem tértek vissza a földre, \r\nhanem az űrhajóikon éltek tovább.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(12, 'A Wall Street farkasa (2013)', 'Életrajzi', 'A tapasztalatlan Jordan Belfort (Leonardo DiCaprio) a Wall Streeten kezdi pályafutását, mint frissen végzett tőzsdealkusz.Már az első \r\nmunkanapján a mély vízbe dobják és értékesítenie kell a cég ügyfeleinek, miközben dolgozik sokat tanul kollégáitól. Egy hónappal \r\nmunkába állása után viszont munkahelye csődbe megy, így Jordan munkanélkülivé válik. Pénzügyi válságban senki nem keres tőzsdei \r\nalkuszt.. míg egy nap talál egy kis céget, ahol filléres részvényeket kell eladnia, viszont a jutaléka hatalmas.', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(13, 'Szólít a szörny (2017)', 'Animáció', 'Conor (Lewis MacDougall) egy 12 éves zárkózott kisfiú, aki kiemelkedő fantáziával és rajztudással rendelkezik. \r\nMindennapjai viszont nem egy hétköznapi 12 éves mindennapjai, az iskolatársai zaklatják és közben édesanyja is \r\nsúlyosan beteg, nem tudni mennyi ideje van még hátra. Conort a nagymamája magához költözteti, de a viszonyuk nem alakul túl jól. \r\nConor a rajzolásba menekül a környezete és a problémái elől. ', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(14, 'Élősködők (2019)', 'Krimi', 'Kim Githek és családja egy Szüuli nyomornegyedben él. Lakásukban nem süt be a nap és a részegek folyton az ablakuk előtt vizelnek. \r\nA család alkalmi munkákból és kispályás furakodásokból tartja fönt magát. Az egyik nap, az egyetemen többször is megbukott Giu \r\nbarátja, Minhjok meglátogatja őket és arra kéri a fiút, hogy amíg ő külföldön van, addig korrepetálja angolból a felső oszálybeli \r\nPak család lányát. Az állás egyszerű és nagyon jól fizet, viszont a Pak család megköveteli az egyetemi végzettséget, ezért a fiú \r\ntestvére, Gidzsong hamisít neki egy egyetemi oklevelet.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(15, 'Új múlt (2021)', 'Romantikus', 'A jövőben az emberek a hétköznapi problémák elől a múlt emlékeiben keresik a menedéküket. Nick Bannister magándetektív (Hugh Jackman) \r\nfelfedezi, hogyan is keltheti fel egyes rég elfeledett emlékeket az emberekben egy speciális gép segítségével. Ez egyik este, zárás \r\nelőtt besétál hozzá a gyönyörű Mae-vel (Rebecca Ferguson) és arra kéri Nicket, hogy segítsen neki megtalálni az elvesztett \r\nlakáskulcsát az emlékei között.', '4', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(16, 'Némaság (2016)', 'Történelmi', 'Két portugál szerzetes Sebastiao Rodrigues (Andrew Garfield) és  Francisco Garrpe (Adam Driver) érkezik a titokzatos Japánba a \r\n17. század közepén. A szerzetesek célja, hogy terjesszék Isten igéjét és közben kiderítsék az igazságot a mentorukró Cristóvao \r\nFerreiráról (Liam Neeson), akiről az a hír terjed, hogy az elszenvedett kínzások közben megtagadta a hitét. A jezsuita szerzetesek \r\nkiszakadva a keresztény Európából egy ismeretlen világban találják magukat.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(17, 'Szerelem és szörnyek (2020)', 'Vígjáték', 'A Földön egy nukleáris szennyezés következtében a bogarak és más csúszómászók gigantikus méretűre nőttek és az emberek java részét \r\nmegették. A megmaradt maréknyi ember a föld alá menekült és elzárva, bunkerekben éli az életét. Az egyik ilyen bunkerben él Joel \r\nDawson (Dylan O’Brien) immáron már hét éve. Joel megszállottan keresi gyerekkori szerelmét Aimee-t (Jessica Henwick). Több ezer \r\nállomást végigpróbálva végre megtalálja a lányt, a tőle 80 mérföldre lévő tengerparti kolónián. Joel elhatározza, hogy feladja a \r\nbunkerbeli életét és szembenézve minden veszéllyel elindul a kolónia felé… hogy újra találkozhasson az egykori szerelmével.', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(18, 'Jexi – Túl okos telefon (2019)', 'Vígjáték', 'Phil egy igazi kétbalkezes, mindent túlkomplikáló, félénk, magának való figura, mindezek mellett masszív telefonfüggő. \r\nEgy napon egy baleset következtében megsérül a telefonja. Az új modellel, egy mesterséges intelligenciát is kap, Jexit. \r\nJexi célja, hogy jobbá tegye a felhasználó életét. Egyszerre tanácsadó, asszisztens, pszichológus és minden lehetséges \r\nmódon szívatja Philt, hogy visszarázza őt az életbe.', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(19, 'Bloodshot (2020)', 'Sci-fi', 'Ray Garrison(Vin Diesel) egy túszmentési katonai bevetésen vesz részt. A bevetés után hazatér a feleségéhez, de másnap \r\nismeretlen fegyveresek jelennek meg és túszul ejtik őket. A fegyveresek a pár nappal ezelőtti akció ötletgazdájának a nevét \r\nszeretnék megtudni. Mivel nem járnak sikerrel így lelövik Ray feleségét, majd a férfit is. Ray egy műtőasztalon tér magához, \r\nés nem emlékszik semmire. Dr. Emil Harting egy titkos eljárásnak vetette őt alá, a véráramába nanorobotokat juttatott, melyek \r\nvisszahozták az élők közé, emellett az apró robotok az erejét, a gyorsaságát és a regenerációs képességét is megsokszorozzák.\r\n', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(20, 'Jurassic World: Bukott birodalom (2018)', 'Sci-fi', 'Owen Grady (Chris Pratt) és Claire Dearing (Bryce Dallas Howard) egy kis csapatukkal visszatérnek a már dínók által uralt Isla \r\nNublar szigetére, ahol egy vulkán készül kitörni, ami a sziget megsemmisülését jelenti. Útjukat egy idős milliomos pénzeli, \r\nde a fiatal unokaöccsének jelentős beleszólása van a dologba. Célja, hogy a megmentett őslényeket egyenként elárverezik unatkozó \r\nmilliomosok számára és közben jól megszedik magukat.', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(21, 'Aladdin (2019)', 'Családi', 'Jafar, a szultán tanácsosa beküldi Aladint a csodák barlangjába, hogy hozza ki neki a barlang mélyén található lámpást. \r\nFigyelmeztetni, hogy csak a lámpást hozza ki, semmilyen más kincshez még csak hozzá ne érjen. Aladin megszerzi a lámpást, \r\nde közben Abunak egy hatalmas gyémánt is megtetszik, így a barlang bezárul és ott rekednek a mélységben. Aladin véletlen \r\nmegtörölgeti a lámpást és egy kék színű dzsin jön elő abból. Közli Aladinnal, hogy teljesíti 3 kívánságát. Aladin azt kívánja, \r\nhogy legyen gazdag és híres, hogy Jázmin hercegnőnél legyen esélye. A dzsin teljesíti a kívánságot és Aladin jázmin hercegnő \r\nkérői közé léphet. ', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(22, 'A Greyhound csatahajó (2020)', 'Történelmi', '1942-ben, az Egyesült Államok hadba lépését követően Krause kapitány (Tom Hanks) kapja a legveszélyesebb háborús feladatot. \r\n37 hajóból álló flottát kell átjuttatnia az Atlanti-óceán véres hadszinterén keresztül. Nem csak a német ellenséggel kell \r\nfarkasszemet néznie, hanem saját félelmeivel, a tengerészek közötti ellentétekkel és a kegyetlen időjárással is meg kell \r\nküzdenie. ', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(23, 'Raya és az utolsó sárkány (2021)', 'Családi', 'Kumandrában az emberek békében éltek a varázslatos sárkányokkal. viszont feltűnt egy közös ellenség a Druunok, akik minden \r\néletet el akarnak pusztítani, és akihez hozzáérnek azt kővé változtatják. A megmaradt sárkányok összegyűjtik az erejüket, és \r\nönmaguk feláldozásával leszámolnak a Druunokkal. Kumandra feldarabolódik és  az emberek ellenségek lesznek. 500 év elteltével \r\na Druunok újra megjelennek és az embereket sanyargatják. Az emberek összevesznek a sárkánykövön, amit ez egyetlen fegyvernek \r\ngondolnak a Druunok elleni háborúban. ', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(24, 'Különösen veszélyes bűnözők (2021)', 'Vígjáték', 'John Hartley (Dwayne Johnson) az FBI különleges ügynöke azt a feladatot kapja, hogy segítsen egy műtárgy ellopásának ügyében. \r\nJohn gyorsan megállapítja, hogy a kiállított műtárgy hamis és üldözőbe veszi a tolvajt, aki a látogatók között rejtőzik. \r\nNolan Booth (Ryan Reynolds) nemzetközi műkincstolvajnak sikerül elmenekülnie, de Hartley az Interpol csapata már várja őt a \r\nlakásán. A rendőrségi akció során, egy beépített személy, kicseréli az eredeti tojást egy másik hamisítvánnyal. A rendőrség \r\nazt hiszi, hogy Hartley az áruló tolvaj közöttük, így egy orosz börtönbe zárják, ugyanoda ahova Booth-ot.', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(25, 'Ted 2 (2015)', 'Vígjáték', 'Fél él telt el azóta, hogy John Bennett (Mark Wahlberg) elvált a feleségétől, Lori Collinstól (Mila Kunis). Ez idő alatt \r\nbarátja Ted (Seth MacFarlane), a beszélő plüssmackó feleségül vette a barátnőjét, Tamy-Lynnt (Jessica Barth). Ted és Tammy-Lynn \r\núgy dönt, hogy szeretnének gyereket. Viszont poblémába ütköznek,ugyanis Ted nem képes a szaporodásra, Lori pedig képtelen teherbe \r\nesni mesterségesen is, mivel a túlzott kábítószer használat tönkre tette a petefészkét. emellett kapnak egy levelet, miszerint \r\nTed egy tárgy, így a házasságuk sem érvényes. Az ügyet perre viszik, amit csak egy kezdő jogász Samantha Jackson vállal el. \r\n', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(26, 'Dzsungeltúra (2021)', 'Családi', '1916-ban, az első világháború második évében Frank (Dwayne Johnson) hajóskapitányként dolgozik és kíváncsi turistákat visz robbant \r\nladikján az amazóniai dzsungelbe. Egy napon felbukkan nála Lily (Emily Blunt) nevű brit tudósnő és annak a testvére, felbérelik a \r\nkapitányt,  hogy vigye el őket a dzsungel legmélyére. Az Élet Fájának legendáját követik, melyről úgy tartja a legenda, hogy egyetlen \r\nvirága minden eddig ismert és ismeretlen eredetű betegséget is képes meggyógyítani. Az idő szorít, ugyanis a titokzatos fát Joachim \r\nherceg is meg szeretné kaparintani magának.', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(27, 'Az igazság bajnokai (2020)', 'Dráma', 'Egy szörnyű vonatbalesetben Mathilde elveszíti édesanyját. Apja, Markus, aki hivatásos katonaként hosszú éveket töltött külföldön hazatér \r\na lányához. A baleset után kis idővel becsönget Markushoz egy idegen, fél karjára béna férfi. Otto, aki a kisiklott vonaton utazott Mathilde \r\nédesanyjával állítja, hogy nem baleset történt.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(28, 'A halhatatlan gárda (2020)', 'Fantasy', 'A világon létezik egy zsoldosokból álló titkos elit különítmény, melyek olyan küldetéseken vesznek részt, amik jobbá teszik az emberek életét. \r\nA csapat vezetője az Andy nevű harcos (Charlize Theron). A soron következő sürgős, jól fizető küldetésüket egy nagy gyógyszeripari cégtől kapják, \r\nazonban a küldetés csapda és a speciális képességeiket többé nem tudják titokban tartani. Andy és a csapat legújabb tagja Nile (Kiki Layne) nem \r\nhagyja annyiban a dolgot.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(29, 'Free Guy (2021)', 'Vígjáték', 'Free City egy nem hétköznapi város, itt mindig történik valami. Minden napos a bankrablás, az hogy tankok mászkálnak az utcán vagy hogy a bűnözők \r\nrabolnak ki járókelőket fényes nappal.  Free City lakója Guy (Ryan Reynolds), aki egy vidám fickó és imádja a városa minden pillanatát. Guy a \r\nbankban dolgozik mint ügyfélszolgálatos. Az egyik nap meglát egy gyönyörű nőt akibe rögtön beleszeret. Követi a nőt, de az a szeme láttára eltűnik \r\negy sikátorban. Guy nem érti, hogy történhetett, míg egy napon fel nem veszi az egyik rabló szemüvegét és egy új, ismeretlen világ tárul a szeme láttára. ', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(30, 'Csillagok között (2014)', 'Sci-fi', 'A Földi életet a kihalás veszélyezteti a nem is túl távoli jövőben. Ezt az tényt nem mindenki hajlandó elfogadni. A NASA egy csapatnyi tudósa 48 évvel ezelőtt \nfelfedezett a Szaturnusz mellett egy féreglyukat, amin keresztül lehetőségük nyílik messzebbre eljutni, mint amire az emberiség történelmében valaha is jutottak. \nA vissza nem térő lehetőséget kihasználva el is indítottak 12 űrhajót fedélzetükön 12 Rangerrel, hogy felfedezzék az ismeretlent, de választ csak 1 helyről kaptak \nvissza. Felkérik Coopert (Matthew McConaughey), aki a NASA legjobb űrhajópilótája volt, hogy egy kis csapatnyi tudóssal keljen keresztül a féreglyukon és derítsék ki, \nhogy lehet e új otthona az emberiségnek, valahol az univerzumban..', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(31, 'Téboly (2020)', 'Thriller', 'Rachel (Caren Pistorius) kamasz fiával, Kyle-lal (Gabriel Bateman) utazik. Rachelnnek rossz napja van. elaludt reggel és a fia késni fog az iskolából, emellett kirúgták az \nállásából és a különélő férje el akarja tőle perelni a házat amiben a fiával él. A jelzőlámpához érve egy furgon áll előtte. A furgon sofőrje nem vette észre, hogy a \njelzőlámpa zöldre váltott. A siető félben lévő és emiatt türelmetlen Rachel pedig rádudál, majd kikerülve a furgonost, elhajt az autópálya felé. Kis idővel később a pályán \ndugóba keveredik és mellé beáll a furgonos, akire az előbb rádudált. A férfi elnézést kér tőle, de a nő nem fogadja el azt. Rachelnek fogalma sincs arról, hogy a furgonban \nülő ismeretlen férfinek is nagyon rossz napja van.\n', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(32, 'Bébi úr: Családi ügy (2021)', 'Családi', 'A civakodó testvérek felnőttek, Tim Templetonból egy családapa lett. Feleségül vette Carolt, és két gyerekük született. Az idősebb Tabitha, a fiatalabb Tina. Tedből befolyásos, \r\nmenő üzletember lett, és semmire se emlékszik a babakorában történtekről. A testvérek között felnőtt korukban is megmaradt a testvéri viszály. Nem beszélnek egymással. Tedet \r\npedig annyira eltemeti a munka, hogy nincs ideje a családjára, ezt azzal kompenzálja, hogy drága ajándékokat vásárol a kishúgainak. Tim az egyik este zajra lesz figyelmes a \r\nkislánya szobájából. Kiderül, hogy Tina is beépített bébi ügynök.\r\n', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(33, 'Gyerekjáték (2019)', 'Horror', 'Buddi a tökéletes társ. A mesterséges intelligenciával rendelkező baba tökéletes beszélgetőpartner, tanulótárs a gyerekek számára. A gyárban ahol a babákat építik, az egyik mérnök \r\nátírja az egyik baba alapprogramját. Karen (Aubrey Plaza) tudtán kívül a fiának Andynak (Gabriel Bateman) vásárolja meg ezt a babát. Kezdetben minden jól alakul. Miután a gyerekek \r\nmegnéznek egy horrorfilmet, a babával együtt, abban a program öntudatra ébred.. először csak káromkodik, aztán egyre tovább és tovább merészkedik. ', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(34, 'Mentőexpedíció (2015)', 'Dráma', '2035-ben az Ares 3 kutatóűrhajó sikeres landolást hajt végre a Mars felszínén, fedélzetén egy tudósokból, geológusokból álló kis csapattal. A leszállás után pár nappal, egy erős \r\nváratlan vihar szakítja félbe a küldetést. A vihar során Mark Watney űrhajós (Matt Damon) elsodródik és a műszerek úgy jelzik, hogy meghalt. Az űrhajója a legénységgel felszáll \r\nés visszaindul a Földre. Watney azonban egy szerencsének köszönhetően túléli a vihart. A következő tervezett Mars küldetés, az Ares 4 csak 4 év múlva fog megérkezni, viszont \r\n3200 km-re fog tőle landolni. Ilyen hosszú időtartamra viszont Mark készletei nem fognak kitartani. \r\n', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(35, 'Ready Player One (2018)', 'Sci-fi', '2044-ben már minden az OASIS-ban, azaz egy virtuális valóság alapú világban történik. Ide járnak az emberek dolgozni, edzeni, itt tartják a kapcsolatot a barátaikkal. \r\nMindent itt csinálnak az evésen és az alváson kívül. Amikor az OASIS-t megálmodó James Halliday meghal, végrendeletéből kiderül, hogy elrejtett egy húsvéti tojást \r\nvalahol az OASIS-on belül. A tojás megszerzéséhez össze kell gyűjteni 3 kulcsot. Aki először megtalálja a kulcsokat és megszerzi a tojást, az megkapja Halliday \r\nrészvényit, ezáltal mesés vagyonra tehet szert és irányíthatja az OASIS-t. A kulcsokat nehéz megtalálni. 3 évvel Halliday halála után, még senki nem talált meg \r\negyet sem. ', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(36, 'A Mitchellék a gépek ellen (2021)', 'Animáció', 'Katie Mitchell egy hétköznapi család nagyobbik gyereke. A lány minden vágya, hogy felvegyék egy filmezéssel foglalkozó iskolába, addig is gyártja a saját maga által összerakott \r\nvideókat, aminek a szereplője az elhízott kutyusa. Sajnos édesapja nem kedveli a lány hobbiját és összevesznek. Békülésképp az apuka kitalálja, hogy elviszi lányát autóval az \r\negyetemre, egy közös családi kirándulás keretében. Az utazás alatt a szemétre kidobott mesterséges intelligencia az emberiség ellen fordul és robotjaival begyűjti az embereket, \r\nhogy kilője őket egy űrhajóval az űr sötét zugába.', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(37, 'Árok (2020)', 'Thriller', 'Mélytengeri kutatásokat végző csapat telepét egy kutatás során váratlan földrengés rázza meg. A létesítmény megsérül és a víz több kabint is eláraszt. Miközben a maréknyi \r\ntúlélő próbál  a felszínre jutni, rájönnek hogy valami más is van a vízben rajtuk kívül. Valami nagyobb és ijesztőbb, amit eddig még soha senki nem látott. Esélyeik \r\ncsekélyek a túlélésre, de minden tőlük tehetőt megtesznek, hogy feljussanak a felszínre épségben.', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(38, 'Wonder Woman 1984 (2020)', 'Fantasy', '1984-ben Diana Prince csendben éli a hétköznapi életét és a Smithsonian Intézet múzeumában dolgozik, mint antropológus. A múzeumba több vizsgálatra érkező tárgy között van \r\negy értéktelen kristály, ami a leírása szerint egy kívánságkő. A kristály bárki kívánságát teljesíti aki megérinti. Max Lord jól tudja ezt és a kőtől reméli élete \r\ngyökeres megváltozását.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(39, 'Sonic, a sündisznó (2020)', 'Családi', 'Sonic, a  15 éves sündisznó egy váratlan esemény következtében különleges erőre tesz szer, ami még önmagát is meglepi. A Föld nevű bolygón rejtőzik el, és egyetlen célja, \r\nhogy a titokban tartsa az erejét és a létezését. Viszont ez nem könnyű egy kamasz számára, főleg ha az még szuper erővel is rendelkezik. Nem sok idő elteltével felfedezi \r\nőt Tom, aki egy kisvárosi rendőr. Tom és Sonic összeáll és kezdetét veszi a kaland.. nyomukban Dr. Robotnyikkal és az ő robotseregével.', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(40, 'Zack Snyder: Az Igazság Ligája (2021)', 'Fantasy', 'Évezredekkel ezelőtt Darkseid és Paradémon seregei rabszolgasorsba akarták taszítani a Földet a három Anyadoboz együttes erejével. A tervüket viszont megakadályozták \r\naz Olimposzi istenek, az amazonok, az atlantisziak, az emberiség és egy Zöld Lámpás szövetsége. miután leszámoltak Darkseid seregével, az anyadobozokat szétválasztották \r\nés a föld különböző pontjai rejtették el. Napjainkban Superman halála után az Anyadobozok újraaktiválódnak és a Földhöz csábítják Steppenwolf-ot, Darkseid egyik szolgáját. \r\nSteppenwolf célja, hogy úgy szerzi vissza hűségét gazdája iránt, hogy megszerzi a dobozokat és megalkotja az “Egységet”.', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(41, 'A kis kedvencek titkos élete 2 (2019)', 'Animáció', 'Kis kedvenceink megint hozzák a formájukat. A történet 3 szálon fut:\r\nMax és Duke gazdijának, Katienek gyereke születik. A vidéken élő rokonuk meghívja őket egy kis kikapcsolódásra, a farmjára. A farmon Max nem boldogul, de hamarosan lesz egy \r\npéldaképe, a bátor és erős Kakas, a farm juhászkutyája. Mielőtt Max a farmra utazott volna, rábízza a kedvenc sárga játékát Gidget-re, aki sikeresen elveszíti azt. A játék \r\nkiesik az ablakon és az alattuk lévő lakásban landol, ahol rengeteg kóbor macska él. Gidget kitalálja, hogy macskaként viselkedve fog belopózni a lakásba, hogy visszaszerezze \r\na játékot. Ehhez viszont segítséget kér egy hatalmas, szürke macskától és annak barátaitól, hogy tanítsák meg őt a macska létre.', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(42, 'Szörnyella (2021)', 'Vígjáték', 'Estella Miller (Emma Stone) kislánykorában szemtanúja lesz, ahogy a gazdag von Hellman bárónő és dalmatái a halálba taszítják az édesanyját. Az árván maradt Estella Londonba \r\nszökik, ahol összebarátkozik két tolvaj utcagyerekkel, Jasperrel és Horace-el. 10 évvel a történtek után, Estella és bandája tolvajként keresi a kenyerét. Estella divatszakértői \r\ntehetségét az álruháik megépítésében éli ki. Jasper és Horace takarítói munkát szerez egy divatáruházban Estellának a születésnapjára. A részeg Estella az egyik este átalakítja \r\na kirakatot és ezzel felkelti a Bárónő figyelmét. A bárónővel dolgozva a lány figyelmes lesz, hogy a felettese olyan nyakláncot visel, mint amilyen az anyukájának is volt. \r\nEstella és bandája betör a bárónőhöz, hogy megszerezzék a nyakláncot.\r\n', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(43, 'Shazam! (2019)', 'Fantasy', 'Az árva  Billy Batson már több nevelőotthonból és nevelőszülőtől is megszökött, de az igazi szüleit nem sikerült megtalálnia. Új nevelőcsaládhoz kerül, nevelőszülei Victor és \r\nRosa Vasquez. Rajta kívül még öt gyereket is nevelnek: Mary Bromfield, Pedro Peña, Eugene Choi, Darla Dudley és Freddy Freemant. Billy egy verekedésbe keveredik a suliban. \r\nMenekülés közben felszáll a metróra, ahonnan egy varázsló barlangjába kerül. Varázsló ereje már a végéhez közeledik, ezért a hatalmas varázserejét Billyre bízza. Ahhoz hogy \r\nszuperhőssé váljon, csak ki kell mondania, hogy Shazam és egy villámcsapás szuperhőssé változtatja.', '6', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(44, 'Gemini Man (2019)', 'Thriller', 'Henry Brogan (Will Smith) volt tengerészgyalogos mesterlövész, aki bérgyilkosként dolgozik a DIA-nél, a szakmája legjobbja. Egy bioterrorista meggyilkolása balul sül el ezért \r\nHenry visszavonul. Később Henry fülébe jut egy információ, miszerint a célpontja, akit megölt a balul elsült akciója alatt, ártatlan volt. Az ügynökség vezetője különleges bérgyilkost \r\nküld Henry után. a férfi fiatalabb mint  Henry és nagyon hasonlít rá külsőleg. Emelett minden lépését előre tudja a férfinak. Henrynek menekülnie kell az üldözője elől, ha életben \r\nakar maradni. ', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(45, 'The Suicide Squad – Az Öngyilkos osztag (2021)', 'Vígjáték', 'Belle Reve büntetés-végrehajtási intézetben több speciális képességekkel rendelkező rab tölti a büntetését. A rabokat csapatba gyűjtik és mindegyik elítélt koponyájába egy apró \r\nrobbanószert ültetnek sebészi út. Ha nem teljesítik a rájuk bízott parancsot vagy ha menekülni próbálnak, akkor felrobbantják azt. A csapatot X különítménynek nevezik el. Feladatuk, \r\nhogy bejussanak Corto Maltese szigetére és megsemmisítsék a Jotunheim nevű tornyot, amiben a tudósok egy rejtélyes „Csillag Projekten” dolgoznak.\r\n', '7', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(46, 'Monster Hunter – Szörnybirodalom (2020)', 'Fantasy', 'Artemis hadnagy (Milla Jovovich) és elit alakulata akciójuk során egy hatalmas viharba kerülnek és egy távoli, ismeretlen, sivatagos bolygón térnek magukhoz.  Az új világot hatalmas, \r\nagresszív szörnyek lakják, melyek elsődleges célja elpusztítani az újonnan érkezőket. Az első ütközetet csak a hadnagy éli túl a csapatából. A halála előtti utolsó percben segítségére \r\nsiet egy harcos, az új világból. Egymás nyelvét nem beszélik, de elkezdődik közöttük egy kapcsolat, melyben kezdetben a túlélésük a cél.', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(47, 'Joker (2019)', 'Krimi', 'Arthur Fleck Gotham Cityben él, édesanyjával, Pennyvel és bohócként dolgozik. Artur egy ritka idegrendszeri betegségben szenved, melyben nem tudja kontollálni a sírást és nevetést . \r\nA város romokban hever és hatalmas a munkanélküliségi ráta. Egyik munkájából hazafelé tartva, egy csoport utcagyerek megveri, ezért kollégájától egy fegyvert kap. Egy gyerekkórházban \r\ntartott fellépése alatt a fegyver véletlen kiesik a zsebéből, és emiatt azonnal kirúgják a munkahelyéről. A metrón három részeg férfi rátámad. Arthur önvédelemből 2 férfit megöl,  a \r\nharmadikat pedig kivégzi. A történteknek híre megy és a város fellázadt lakói szimpatizálni kezdenek a az elkövetővel.\r\n', '9', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(48, 'A Vadász és a Jégkirálynő (2016)', 'Dráma', 'Sok sok évvel ezelőtt, még mielőtt Hófehér éles pengéje végzett volna a gonosz Ravenna királynővel, Ravenna rezzenéstelen arccal asszisztálta végig, ahogy húga, Freya egy árulás áldozata \r\nlett ezért elhagyja a birodalmat. Freya az ifjú jégkirálynő, aki képes egy mozdulattal jégszobrot csinálni az ellenségeiből évtizedeket töltött egy messzi messzi jégpalotában, ahol halálos \r\nvadászokból álló sereget képzett ki magának. A vadászok között volt Eric és Sara is, akik ellentmondtak úrnőjük parancsának: örökre keményítsd meg szívedet a szerelemmel szemben…', '5', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(49, 'Mr. és Mrs. Smith (2005)', 'Vígjáték', '5 évvel ezelőtt Jane és John Kolumbiában talál egymásra egy véletlen során. A kolumbiai rendőrség az egyedül közlekedő turistákat fokozottan ellenőrzi, ezért az akkor egymásnak ismeretlen \r\nJohn és Jane „párt alkotnak”, pár héttel később össze is házasodnak. John úgy tudja, hogy Jane egy számítógépes specialista, míg Jane azt tudja, hogy John  egy építészmérnök. Ez azonban \r\ncsak álca, mivel mind a ketten profi bérgyilkosok, és a cégeik egymással konkurencia harcban állnak.', '8', );
INSERT INTO `filmek` (`Id`, `Cim`, `Kategoria`, `Leiras`, `Ertekeles`, `filmlogo`) VALUES
(50, '007 Nincs idő meghalni (2021)', 'Akció', 'Öt év telt el azóta, hogy James Bond elfogta Ernst Stavro Blofeldot. A 007-es maga mögött hagyta a titkosszolgálatot és élvezi az életet a szerelmével Jamaicán. A mézes heteinek véget vet \r\nrégi ismerőse Felix Leiter CIA-tiszt felbukkanása. Felix Bond segítségét kéri Valdo Obruchev elrabolt tudós felkutatásában. Miközben Bond elindul felderíteni a szálakat, rájön, hogy a \r\nküldetése sokkal kockázatosabb mint az elején gondolta.\r\n', '6', );

